INSERT SPAN_PRODUCT_EXPIRY_DATE (
	bfc_cd
	,trade_type_cd
	,period_cd
	,expiration_dt
	,exchange_cd
	,span_exchange_cd
	)
SELECT BSC.bsc_cd
	,"FUT" trade_type_cd
	,UPPER(LEFT(CONVERT(VARCHAR(11), PCR.final_pricing_dt, 100), 3)) + "-" + LEFT(CONVERT(VARCHAR(11), PCR.final_pricing_dt, 2), 2) period_cd
	,PCR.final_pricing_dt expiration_dt
	,'ICE'
	,'IPE'
FROM BASE_SWAP_CONTRACT BSC
	,EXCH_SWAP_HDR ESH
	,SWAP_HDR SH
	,PCR
WHERE BSC.bsc_cd = ESH.bsc_cd
	AND ESH.hdr_num = SH.hdr_num
	AND ESH.strategy_num = SH.strategy_num
	AND ESH.hdr_num = PCR.hdr_num
	AND ESH.strategy_num = PCR.strategy_num
	AND PCR.realized_dt IS NULL
	AND BSC.exchange_cd = "ICE"
	AND final_pricing_dt > GETDATE()
	AND BSC.setlmnt_periodicity_ind = "E"
	AND BSC.bsc_cd NOT IN (
		SELECT bfc_cd
		FROM SPAN_DAILY_PRODUCT
		WHERE exchange_cd = 'ICE'
		)
	AND BSC.bsc_cd NOT IN (
		SELECT bfc_cd
		FROM ICE_BALMO_PRODUCT
		)
GROUP BY BSC.bsc_cd
	,PCR.final_pricing_dt
	,BSC.setlmnt_periodicity_ind
ORDER BY BSC.bsc_cd
GO

