/*****************************************************************************/
/*** Load all the futures.                                                   */
/*****************************************************************************/
PRINT 'Futures Load'
GO

INSERT SPAN_LOAD (
	span_trade_type_cd
	,trade_type_ind
	,strategy_num
	,period_cd
	,exchange_cd
	,bfc_cd
	,instrument_text
	,long_lots
	,short_lots
	,clearing_broker_cd
	)
SELECT 'FUT'
	,LT.trade_type_ind
	,LT.strategy_num
	,LT.period_cd
	,BFC.exchange_cd
	,BFC.bfc_cd
	,BFC.bfc_name
	,CONVERT(INT, SUM(CASE 
				WHEN LT.bs_ind = 'B'
					THEN ABS((PCR.pos_qty / 100.0 * PCR.fixed1_pct) / ((LT.contract_qty / 100.0) / LT.lots))
				ELSE 0
				END)) "Long"
	,CONVERT(INT, SUM(CASE 
				WHEN LT.bs_ind = 'S'
					THEN ABS((PCR.pos_qty / 100.0 * PCR.fixed1_pct) / ((LT.contract_qty / 100.0) / LT.lots))
				ELSE 0
				END)) "Short"
	,LT.clearing_broker_cd
FROM PCR
	,LISTED_TRADE LT
	,BASE_FUTURE_CONTRACT BFC
WHERE PCR.strategy_num = LT.strategy_num
	AND PCR.trade_num = LT.trade_num
	AND BFC.bfc_cd = LT.bfc_cd
	AND PCR.realized_dt IS NULL
	AND PCR.trade_type_ind = "F"
	AND PCR.trade_status_ind <> 'C'
	AND LT.posted_dt IS NOT NULL
	AND LT.trade_dt < CONVERT(CHAR(8), GETDATE(), 112)
	AND LT.trade_type_ind = "F"
	AND LT.trade_status_ind <> 'C'
	AND LT.contract_qty <> 0
	AND LT.lots <> 0
	AND BFC.exchange_cd NOT IN (
		'LME'
		,'EURONEXT'
		)
GROUP BY LT.trade_type_ind
	,LT.strategy_num
	,LT.period_cd
	,BFC.exchange_cd
	,BFC.bfc_cd
	,BFC.bfc_name
	,LT.clearing_broker_cd
GO

INSERT SPAN_LOAD (
	span_trade_type_cd
	,trade_type_ind
	,strategy_num
	,period_cd
	,sort_dt
	,exchange_cd
	,bfc_cd
	,instrument_text
	,long_lots
	,short_lots
	,clearing_broker_cd
	)
SELECT 'FUT'
	,LT.trade_type_ind
	,LT.strategy_num
	,UPPER(LEFT(CONVERT(VARCHAR(11), FC.expire_dt, 100), 3)) + "-" + LEFT(CONVERT(VARCHAR(11), FC.expire_dt, 2), 2)
	,FC.expire_dt
	,BFC.exchange_cd
	,BFC.bfc_cd
	,BFC.bfc_name
	,CONVERT(INT, SUM(CASE 
				WHEN LT.bs_ind = 'B'
					THEN ABS((PCR.pos_qty / 100.0 * PCR.fixed1_pct) / ((LT.contract_qty / 100.0) / LT.lots))
				ELSE 0
				END)) "Long"
	,CONVERT(INT, SUM(CASE 
				WHEN LT.bs_ind = 'S'
					THEN ABS((PCR.pos_qty / 100.0 * PCR.fixed1_pct) / ((LT.contract_qty / 100.0) / LT.lots))
				ELSE 0
				END)) "Short"
	,LT.clearing_broker_cd
FROM PCR
	,LISTED_TRADE LT
	,BASE_FUTURE_CONTRACT BFC
	,FUTURE_CONTRACT FC
WHERE PCR.strategy_num = LT.strategy_num
	AND PCR.trade_num = LT.trade_num
	AND BFC.bfc_cd = LT.bfc_cd
	AND PCR.realized_dt IS NULL
	AND PCR.trade_type_ind = "F"
	AND PCR.trade_status_ind <> 'C'
	AND LT.posted_dt IS NOT NULL
	AND LT.trade_dt < CONVERT(CHAR(8), GETDATE(), 112)
	AND LT.trade_type_ind = "F"
	AND LT.trade_status_ind <> 'C'
	AND LT.contract_qty <> 0
	AND LT.lots <> 0
	AND FC.bfc_cd = BFC.bfc_cd
	AND FC.period_cd = LT.period_cd
	AND BFC.exchange_cd IN (
		'LME'
		,'EURONEXT'
		)
GROUP BY LT.trade_type_ind
	,LT.strategy_num
	,FC.expire_dt
	,BFC.exchange_cd
	,BFC.bfc_cd
	,BFC.bfc_name
	,LT.clearing_broker_cd
ORDER BY FC.expire_dt
GO

