INSERT SPAN_LOAD (
	span_trade_type_cd
	,trade_type_ind
	,strategy_num
	,period_cd
	,exchange_cd
	,bfc_cd
	,instrument_text
	,strike_price
	,pc_ind
	,long_lots
	,short_lots
	,listed_premium_spent
	,clearing_broker_cd
	)
SELECT 'OOF'
	,EOH.option_type_ind
	,EOH.strategy_num
	,OT.period_cd
	,BFC.exchange_cd
	,BFC.boc_cd
	,BFC.boc_name
	,OH.strike_price / 100.0 strike
	,OH.pc_ind
	,SUM(CASE 
			WHEN OH.bs_ind = 'B'
				THEN ABS(OH.contract_qty / 100.0)
			ELSE 0
			END)
	,SUM(CASE 
			WHEN OH.bs_ind = 'S'
				THEN ABS(OH.contract_qty / 100.0)
			ELSE 0
			END)
	,SUM((
			CASE 
				WHEN OH.bs_ind = 'B'
					THEN 1
				ELSE - 1
				END
			) * (premium / 100) * (payment_qty / 100))
	,EOH.clearing_broker_cd
FROM PCR PCR
	,EXCH_OPTION_HDR EOH
	,OTC_OPTION_HDR OH
	,OTC_OPTION_TRADE OT
	,BASE_OPTION_CONTRACT BFC
WHERE PCR.strategy_num = EOH.strategy_num
	AND PCR.hdr_num = EOH.hdr_num
	AND EOH.strategy_num = OH.strategy_num
	AND EOH.hdr_num = OH.hdr_num
	AND EOH.strategy_num = OT.strategy_num
	AND EOH.hdr_num = OT.hdr_num
	AND PCR.trade_num = OT.trade_num
	AND BFC.boc_cd = EOH.boc_cd
	AND PCR.realized_dt IS NULL
	AND PCR.trade_type_ind = "C"
	AND PCR.trade_status_ind <> 'C'
	AND EOH.trade_dt < convert(CHAR(8), GETDATE(), 112)
	AND OH.trade_status_ind <> 'C'
	AND PCR.pcr_type_ind = "S"
	--AND (
	--	BFC.boc_cd = 'NIO'
	--	AND BFC.exchange_cd = 'LME'
	--	AND EOH.clearing_broker_cd IS NOT NULL
	--	)
GROUP BY EOH.option_type_ind
	,EOH.strategy_num
	,OT.period_cd
	,BFC.exchange_cd
	,BFC.boc_cd
	,BFC.boc_name
	,OH.strike_price
	,OH.pc_ind
	,EOH.clearing_broker_cd
ORDER BY boc_cd
GO

/*****************************************************************************/
/*** Load all APO options.                                                   */
/*****************************************************************************/
PRINT '2-Way APO Options Load'
GO

	strategy_num
	,OOT.period_cd
	,cmdty_cd
	,exchange_cd
	,bs_ind
	,pc_ind
	,strike_price
	,pos_vol
	,lot_uom_cd
	,lotsize
	,span_trade_type_cd
	,trade_type_ind
	)
SELECT TS.strategy_num
	,OOT.period_cd
	,CASE 
		WHEN LEFT(FC2.quote1_def_cd, LEN(FC2.quote1_def_cd) - 3) = LEFT(FC.quote1_def_cd, LEN(FC.quote1_def_cd) - 3)
			THEN CASE 
					WHEN CE.exchange_cd <> 'IPE'
						THEN 'OOC-'
					ELSE 'OOF-'
					END + TS.cmdty_cd + CASE 
					WHEN RIGHT(FC.quote1_def_cd, 3) <> RIGHT(FC2.quote1_def_cd, 3)
						THEN CONVERT(VARCHAR(2), DATEDIFF(MONTH, CONVERT(DATETIME, CONVERT(VARCHAR(2), CHARINDEX(RIGHT(FC.quote1_def_cd, 1), 'FGHJKMNQUVXZ')) + '/1/20' + LEFT(RIGHT(FC.quote1_def_cd, 3), 2)), CONVERT(DATETIME, CONVERT(VARCHAR(2), CHARINDEX(RIGHT(FC2.quote1_def_cd, 1), 'FGHJKMNQUVXZ')) + '/1/20' + LEFT(RIGHT(FC2.quote1_def_cd, 3), 2))))
					ELSE '1'
					END
		ELSE 'OOF-' + LEFT(FC.quote1_def_cd, LEN(FC.quote1_def_cd) - 3) + '-' + LEFT(FC2.quote1_def_cd, LEN(FC2.quote1_def_cd) - 3)
		END AS cmdty_cd
	,CE.exchange_cd
	,TS.bs_ind
	,TS.pc_ind
	,TS.strike_price / 100.0
	,ABS(PCR.pos_vol / 100.0)
	,CE.lot_uom_cd
	,CE.lotsize / 100.0 "lotsize"
	,CASE 
		WHEN LEFT(FC2.quote1_def_cd, LEN(FC2.quote1_def_cd) - 3) = LEFT(FC.quote1_def_cd, LEN(FC.quote1_def_cd) - 3)
			AND CE.exchange_cd <> 'IPE'
			THEN 'OOC'
		ELSE 'OOF'
		END
	,CASE 
		WHEN LEFT(FC2.quote1_def_cd, LEN(FC2.quote1_def_cd) - 3) = LEFT(FC.quote1_def_cd, LEN(FC.quote1_def_cd) - 3)
			THEN 'U'
		ELSE 'L'
		END
FROM PCR
	,TRADE_SUMMARY TS
	,FORMULA_COMPONENT FC
	,FORMULA_COMPONENT FC2
	,QUOTE_DEFINITION QD
	,COMMODITY_EXCHANGE CE
	,OTC_OPTION_TRADE OOT
WHERE PCR.strategy_num = TS.strategy_num
	AND PCR.pcr_num = TS.pcr_num
	AND FC.strategy_num = PCR.strategy_num
	AND TS.hdr_num = OOT.hdr_num
	AND TS.trade_num = OOT.trade_num
	AND TS.strategy_num = OOT.strategy_num
	AND FC.hdr_num = PCR.hdr_num
	AND FC.formula_num = 1
	AND FC.formula_comp_num = 1
	AND QD.quote_def_cd = FC.quote1_def_cd
	AND CE.cmdty_cd = TS.cmdty_cd
	AND FC2.strategy_num = PCR.strategy_num
	AND FC2.hdr_num = PCR.hdr_num
	AND FC2.formula_num = 2
	AND FC2.formula_comp_num = 1
	AND PCR.trade_type_ind = '2'
	AND PCR.trade_status_ind <> 'C'
	AND PCR.realized_dt IS NULL
	AND PCR.pcr_type_ind = 'S'
	AND TS.trade_dt < CONVERT(CHAR(8), GETDATE(), 112)
	AND TS.trade_type_ind = '2'
GO

