INSERT SPAN_LOAD (
	span_trade_type_cd
	,trade_type_ind
	,strategy_num
	,period_cd
	,exchange_cd
	,bfc_cd
	,instrument_text
	,strike_price
	,pc_ind
	,long_lots
	,short_lots
	,listed_premium_spent
	,clearing_broker_cd
	)
SELECT 'OOF'
	,LT.trade_type_ind
	,LT.strategy_num
	,LT.period_cd
	,BFC.exchange_cd
	,BFC.bfc_cd
	,BFC.bfc_name
	,LT.strike_price / 100.0
	,LT.pc_ind
	,CONVERT(INT, SUM(CASE 
				WHEN LT.bs_ind = 'B'
					THEN ABS((PCR.pos_qty / 100.0) / ((LT.contract_qty / 100.0) / LT.lots))
				ELSE 0
				END)) "Long"
	,CONVERT(INT, SUM(CASE 
				WHEN LT.bs_ind = 'S'
					THEN ABS((PCR.pos_qty / 100.0) / ((LT.contract_qty / 100.0) / LT.lots))
				ELSE 0
				END)) "Short"
	,SUM((
			CASE 
				WHEN PCR.cost_revenue_ind = "R"
					THEN - 1
				ELSE 1
				END
			) * PCR.extended_amt / 100.0)
	,LT.clearing_broker_cd
FROM PCR PCR
	,LISTED_TRADE LT
	,BASE_FUTURE_CONTRACT BFC
WHERE PCR.strategy_num = LT.strategy_num
	AND PCR.trade_num = LT.trade_num
	AND BFC.bfc_cd = LT.bfc_cd
	AND LT.contract_qty <> 0
	AND LT.lots <> 0
	AND PCR.realized_dt IS NULL
	AND PCR.trade_type_ind = 'L'
	AND PCR.trade_status_ind <> 'C'
	AND LT.trade_dt < CONVERT(CHAR(8), GETDATE(), 112)
	AND LT.option_status_ind IN (
		'A'
		,'E'
		)
	AND LT.trade_type_ind = 'L'
	AND LT.trade_status_ind <> 'C'
GROUP BY LT.trade_type_ind
	,LT.strategy_num
	,LT.period_cd
	,BFC.exchange_cd
	,BFC.bfc_cd
	,BFC.bfc_name
	,LT.strike_price
	,LT.pc_ind
	,LT.clearing_broker_cd
GO

INSERT SPAN_LOAD (
	span_trade_type_cd
	,trade_type_ind
	,strategy_num
	,period_cd
	,exchange_cd
	,bfc_cd
	,instrument_text
	,strike_price
	,pc_ind
	,long_lots
	,short_lots
	,listed_premium_spent
	)
SELECT 'OOF'
	,OH.trade_type_ind
	,OT.strategy_num
	,QD.period_cd
	,CASE C.co_cd
		WHEN 'NYME'
			THEN 'NYMEX CP'
		WHEN 'ICE CLEARED'
			THEN 'ICE'
		ELSE 'UNKNOWN'
		END
	,SUBSTRING(FC.quote1_def_cd, 1, LEN(FC.quote1_def_cd) - 3)
	,SUBSTRING(FC.quote1_def_cd, 1, LEN(FC.quote1_def_cd) - 3)
	,OH.strike_price / 100.0 strike
	,OH.pc_ind
	,CONVERT(INT, SUM(CASE 
				WHEN UOM.uom_type_ind = 'V'
					AND OH.bs_ind = 'B'
					THEN ABS(PCR.pos_vol / 1000.0)
				WHEN UOM.uom_type_ind = 'M'
					AND OH.bs_ind = 'B'
					THEN ABS(PCR.pos_mass / 1000.0)
				ELSE 0
				END)) "Long"
	,CONVERT(INT, SUM(CASE 
				WHEN UOM.uom_type_ind = 'V'
					AND OH.bs_ind = 'S'
					THEN ABS(PCR.pos_vol / 1000.0)
				WHEN UOM.uom_type_ind = 'M'
					AND OH.bs_ind = 'S'
					THEN ABS(PCR.pos_mass / 1000.0)
				ELSE 0
				END)) "Short"
	,SUM((
			CASE 
				WHEN OH.bs_ind = 'B'
					THEN 1
				ELSE - 1
				END
			) * (OH.premium / 1000) * (payment_qty / 1000))
FROM OTC_OPTION_HDR OH
	,OTC_OPTION_TRADE OT
	,CONTRACT C
	,PCR
	,UOM
	,FORMULA_COMPONENT FC
	,QUOTE_DEFINITION QD
WHERE OT.strategy_num = OH.strategy_num
	AND OT.hdr_num = OH.hdr_num
	AND OH.hdr_num = FC.hdr_num
	AND OH.strategy_num = FC.strategy_num
	AND PCR.qty_uom_cd = UOM.uom_cd
	AND PCR.strategy_num = OT.strategy_num
	AND PCR.hdr_num = OT.hdr_num
	AND PCR.trade_num = OT.trade_num
	AND PCR.realized_dt IS NULL
	AND PCR.trade_type_ind = "U"
	AND PCR.trade_status_ind <> 'C'
	AND OH.trade_type_ind = "U"
	AND OH.trade_status_ind <> 'C'
	AND PCR.pcr_type_ind = 'S'
	AND FC.quote1_def_cd = QD.quote_def_cd
	AND C.contract_num = OH.contract_num
	AND C.co_cd IN (
		'NYME'
		,'ICE CLEARED'
		)
	AND C.contract_dt < CONVERT(CHAR(8), GETDATE(), 112)
GROUP BY OH.trade_type_ind
	,OT.strategy_num
	,QD.period_cd
	,C.co_cd
	,SUBSTRING(FC.quote1_def_cd, 1, LEN(FC.quote1_def_cd) - 3)
	,OH.strike_price / 100.0
	,OH.pc_ind
GO

