	,CONVERT(INT, SUM(CASE 
				WHEN UOM.uom_type_ind = 'V'
					AND SH.bs_spread_ind = 'B'
					THEN ABS(PCR.pos_vol / 100.0)
				WHEN UOM.uom_type_ind = 'M'
					AND SH.bs_spread_ind = 'B'
					THEN ABS(PCR.pos_mass / 100.0)
				ELSE 0
				END)) / (
		DATEDIFF(DAY, ISNULL(ST.price_start_dt1, ST.price_start_dt2), ISNULL(ST.price_end_dt1, ST.price_end_dt2)) - (DATEDIFF(WEEK, ISNULL(ST.price_start_dt1, ST.price_start_dt2), ISNULL(ST.price_end_dt1, ST.price_end_dt2)) * 2) - CASE 
			WHEN DATEPART(WEEKDAY, ISNULL(ST.price_start_dt1, ST.price_start_dt2)) = 1
				THEN 1
			ELSE 0
			END + CASE 
			WHEN DATEPART(WEEKDAY, ISNULL(ST.price_end_dt1, ST.price_end_dt2)) = 1
				THEN 1
			ELSE 0
			END + 1
		) "Long"
	,CONVERT(INT, SUM(CASE 
				WHEN UOM.uom_type_ind = 'V'
					AND SH.bs_spread_ind = 'S'
					THEN ABS(PCR.pos_vol / 100.0)
				WHEN UOM.uom_type_ind = 'M'
					AND SH.bs_spread_ind = 'S'
					THEN ABS(PCR.pos_mass / 100.0)
				ELSE 0
				END)) / (
		DATEDIFF(DAY, ISNULL(ST.price_start_dt1, ST.price_start_dt2), ISNULL(ST.price_end_dt1, ST.price_end_dt2)) - (DATEDIFF(WEEK, ISNULL(ST.price_start_dt1, ST.price_start_dt2), ISNULL(ST.price_end_dt1, ST.price_end_dt2)) * 2) - CASE 
			WHEN DATEPART(WEEKDAY, ISNULL(ST.price_start_dt1, ST.price_start_dt2)) = 1
				THEN 1
			ELSE 0
			END + CASE 
			WHEN DATEPART(WEEKDAY, ISNULL(ST.price_end_dt1, ST.price_end_dt2)) = 1
				THEN 1
			ELSE 0
			END + 1
		) "Short"
	,'DAILY'
	,ESH.clearing_broker_cd
FROM EXCH_SWAP_HDR ESH
	,SWAP_HDR SH
	,SWAP_TRADE ST
	,PCR
	,UOM
	,BASE_SWAP_CONTRACT BSC
	,SPAN_DAILY_PRODUCT SDP
	,(
		SELECT DATEADD(DAY, number, DATEADD(MONTH, - 1, CAST(GETDATE() AS DATE))) calc_date
		FROM master..spt_values
		WHERE type = 'P'
			AND number <= DATEDIFF(DAY, DATEADD(MONTH, - 1, CAST(GETDATE() AS DATE)), DATEADD(MONTH, 6, CAST(GETDATE() AS DATE)))
			AND DATEPART(WEEKDAY, DATEADD(DAY, number, DATEADD(MONTH, - 1, CAST(GETDATE() AS DATE)))) NOT IN (
				1
				,7
				)
			AND DATEADD(DAY, number, DATEADD(MONTH, - 1, CAST(GETDATE() AS DATE))) != '7/4/2018'
		) AS DR
WHERE ESH.strategy_num = SH.strategy_num
	AND ESH.hdr_num = SH.hdr_num
	AND ESH.trade_dt < CONVERT(CHAR(8), GETDATE(), 112)
	AND ESH.bsc_cd = BSC.bsc_cd
	AND ST.strategy_num = SH.strategy_num
	AND ST.hdr_num = SH.hdr_num
	AND PCR.qty_uom_cd = UOM.uom_cd
	AND PCR.strategy_num = ST.strategy_num
	AND PCR.hdr_num = ST.hdr_num
	AND PCR.trade_num = ST.trade_num
	AND PCR.realized_dt IS NULL
	AND PCR.trade_type_ind = "D"
	AND PCR.trade_status_ind <> 'C'
	AND CASE 
		WHEN BSC.setlmnt_periodicity_ind = 'E'
			THEN UPPER(CONVERT(CHAR(3), ISNULL(ST.price_end_dt1, ST.price_end_dt2), 7)) + "-" + CONVERT(CHAR(2), ISNULL(ST.price_end_dt1, ST.price_end_dt2), 2)
		ELSE ST.period_cd
		END IS NOT NULL
	AND DR.calc_date >= ISNULL(ST.price_start_dt1, ST.price_start_dt2)
	AND DR.calc_date <= ISNULL(ST.price_end_dt1, ST.price_end_dt2)
	AND SDP.bfc_cd = ESH.bsc_cd
	AND SDP.weekend = 0
	AND SDP.exchange_cd = 'NYMEX CP'
GROUP BY PCR.trade_type_ind
	,ST.strategy_num
	,CASE 
		WHEN BSC.setlmnt_periodicity_ind = 'E'
			THEN UPPER(CONVERT(CHAR(3), ISNULL(ST.price_end_dt1, ST.price_end_dt2), 7)) + "-" + CONVERT(CHAR(2), ISNULL(ST.price_end_dt1, ST.price_end_dt2), 2)
		ELSE ST.period_cd
		END
	,DR.calc_date
	,ESH.exchange_cd
	,ESH.bsc_cd
	,DATEDIFF(DAY, ISNULL(ST.price_start_dt1, ST.price_start_dt2), ISNULL(ST.price_end_dt1, ST.price_end_dt2)) - (DATEDIFF(WEEK, ISNULL(ST.price_start_dt1, ST.price_start_dt2), ISNULL(ST.price_end_dt1, ST.price_end_dt2)) * 2) - CASE 
		WHEN DATEPART(WEEKDAY, ISNULL(ST.price_start_dt1, ST.price_start_dt2)) = 1
			THEN 1
		ELSE 0
		END + CASE 
		WHEN DATEPART(WEEKDAY, ISNULL(ST.price_end_dt1, ST.price_end_dt2)) = 1
			THEN 1
		ELSE 0
		END + 1
	,ESH.clearing_broker_cd
HAVING DR.calc_date >= DATEADD(DAY, - 9, GETDATE())
GO

