INSERT SPAN_LOAD (
	span_trade_type_cd
	,trade_type_ind
	,strategy_num
	,period_cd
	,sort_dt
	,exchange_cd
	,bfc_cd
	,long_lots
	,short_lots
	)
SELECT 'FUT'
	,SH.trade_type_ind
	,ST.strategy_num
	,CONVERT(CHAR(6), P.pricing_dt, 112) period_cd
	,P.pricing_dt
	,CASE C.co_cd
		WHEN 'NYME'
			THEN 'NYMEX CP'
		WHEN 'ICE CLEARED'
			THEN 'ICE'
		ELSE 'UNKNOWN'
		END
	,P.quote_def_cd
	,CONVERT(INT, SUM(CASE 
				WHEN UOM.uom_type_ind = 'V'
					AND SH.swap_payor_type_ind = 'F'
					THEN ABS(PCR.pos_vol * P.pricing_pct / 100.0)
				WHEN UOM.uom_type_ind = 'M'
					AND SH.swap_payor_type_ind = 'F'
					THEN ABS(PCR.pos_mass * P.pricing_pct / 100.0)
				ELSE 0
				END)) "Long"
	,CONVERT(INT, SUM(CASE 
				WHEN UOM.uom_type_ind = 'V'
					AND SH.swap_payor_type_ind = 'A'
					THEN ABS(PCR.pos_vol * P.pricing_pct / 100.0)
				WHEN UOM.uom_type_ind = 'M'
					AND SH.swap_payor_type_ind = 'A'
					THEN ABS(PCR.pos_mass * P.pricing_pct / 100.0)
				ELSE 0
				END)) "Short"
FROM SWAP_HDR SH
	,SWAP_TRADE ST
	,CONTRACT C
	,PCR
	,PRICING P
	,UOM
WHERE ST.strategy_num = SH.strategy_num
	AND ST.hdr_num = SH.hdr_num
	AND P.trade_num = ST.trade_num
	AND PCR.qty_uom_cd = UOM.uom_cd
	AND PCR.strategy_num = ST.strategy_num
	AND PCR.hdr_num = ST.hdr_num
	AND PCR.trade_num = ST.trade_num
	AND PCR.realized_dt IS NULL
	AND PCR.trade_type_ind = "S"
	AND PCR.trade_status_ind <> 'C'
	AND SH.trade_type_ind = "S"
	AND SH.trade_status_ind <> 'C'
	AND C.contract_num = SH.contract_num
	AND C.co_cd IN (
		'NYME'
		,'ICE CLEARED'
		)
	AND C.contract_dt < CONVERT(CHAR(8), GETDATE(), 112)
	AND P.quote_def_cd IN ('GDHenryHub')
	AND P.pricing_dt >= CONVERT(CHAR(8), dateadd(day, - 1, GETDATE()), 112)
GROUP BY SH.trade_type_ind
	,ST.strategy_num
	,P.pricing_dt
	,C.co_cd
	,P.quote_def_cd
GO

/****************************/
/* Determine product codes. */
/****************************/
UPDATE SPAN_LOAD
SET SPAN_LOAD.span_exchange_cd = 'NDL'
	,SPAN_LOAD.span_clearing_house_cd = 'NDL'
WHERE SPAN_LOAD.exchange_cd = 'NODAL'
GO

UPDATE SPAN_LOAD
SET span_exchange_cd = SE.span_exchange_cd
	,span_clearing_house_cd = SE.span_clearing_house_cd
	,span_account_ind = SE.span_account_ind
FROM SPAN_EXCHANGE SE
WHERE SPAN_LOAD.exchange_cd = SE.exchange_cd
GO

/* Assign span_bfc_cd and span_product_cd for exchange_cd other than 'NYMEX CP' and 'IPE'. */
UPDATE SPAN_LOAD
SET span_bfc_cd = P.combination_cd
	,span_product_cd = P.product_cd
FROM SPAN_PRODUCT P
WHERE SPAN_LOAD.bfc_cd = P.bfc_cd
	AND SPAN_LOAD.span_trade_type_cd = P.trade_type_cd
	AND SPAN_LOAD.exchange_cd = P.exchange_cd
GO

SELECT * FROM SPAN_LOAD WHERE bfc_cd = 'RFC'
GO

/* Assign span_clearing_house_cd and span_exchange_cd for exchange_cd CBOT and KCB. */
UPDATE SPAN_LOAD
SET SPAN_LOAD.span_exchange_cd = 'CBT'
	,span_clearing_house_cd = 'CME'
FROM SPAN_PRODUCT P
WHERE SPAN_LOAD.span_exchange_cd IS NULL
	AND span_clearing_house_cd IS NULL
	AND span_bfc_cd = P.combination_cd
	AND SPAN_LOAD.exchange_cd = P.exchange_cd
	AND SPAN_LOAD.exchange_cd IN (
		'CBOT'
		,'KCB'
		)
GO

/* Assign span_clearing_house_cd and span_exchange_cd for exchange_cd ENC. */
UPDATE SPAN_LOAD
SET SPAN_LOAD.span_exchange_cd = 'ENC'
FROM SPAN_PRODUCT P
WHERE span_clearing_house_cd = 'LCH'
	AND span_bfc_cd = P.combination_cd
	AND SPAN_LOAD.exchange_cd = P.exchange_cd
	AND SPAN_LOAD.exchange_cd = 'LCH'
GO

/* Assign span_clearing_house_cd and span_exchange_cd for exchange_cd LME. */
UPDATE SPAN_LOAD
SET SPAN_LOAD.span_exchange_cd = 'LME'
	,trade_type = 'DAILY'
	,span_clearing_house_cd = 'LCH'
	,trade_type_ind = 'D'
FROM SPAN_PRODUCT P
WHERE span_clearing_house_cd IS NULL
	AND span_bfc_cd = P.combination_cd
	AND SPAN_LOAD.exchange_cd = P.exchange_cd
	AND SPAN_LOAD.exchange_cd = 'LME'
GO

/* Assign span_clearing_house_cd and span_exchange_cd for exchange_cd CME. */
UPDATE SPAN_LOAD
SET SPAN_LOAD.span_exchange_cd = 'CME'
	,span_clearing_house_cd = 'CME'
FROM SPAN_PRODUCT P
WHERE SPAN_LOAD.span_exchange_cd IS NULL
	AND span_clearing_house_cd IS NULL
	AND span_bfc_cd = P.combination_cd
	AND SPAN_LOAD.exchange_cd = P.exchange_cd
	AND SPAN_LOAD.exchange_cd = 'CME'
GO

/* Assign span_clearing_house_cd and span_exchange_cd for exchange_cd COMEX. */
UPDATE SPAN_LOAD
SET SPAN_LOAD.span_exchange_cd = 'CMX'
	,span_clearing_house_cd = 'CME'
FROM SPAN_PRODUCT P
WHERE SPAN_LOAD.span_exchange_cd IS NULL
	AND span_clearing_house_cd IS NULL
	AND span_bfc_cd = P.combination_cd
	AND SPAN_LOAD.exchange_cd = P.exchange_cd
	AND SPAN_LOAD.exchange_cd = 'COMEX'
GO

/* Assign span_clearing_house_cd and span_exchange_cd for exchange_cd MGE. */
UPDATE SPAN_LOAD
SET SPAN_LOAD.span_exchange_cd = 'MGE'
	,span_clearing_house_cd = 'MGE'
FROM SPAN_PRODUCT P
WHERE SPAN_LOAD.span_exchange_cd IS NULL
